import React from 'react'
import './directory.styles.scss';

const directory =({title})=>(
    <div className="directory">
    <div className="items">
        <h2 className="{title}">HATS</h2>
        <span className="sub-title">big</span>
    </div>
</div>
);
    
export default directory;
